import React, { useState, useEffect } from "react";
import Axios from "axios";
import Select from "react-select";
import { Header } from "./PagesElements";
import "./PagesElements.css";
  
const Search = () => {
  const [pesel, setPesel] = useState("");
  const [data_od, setDataOd] = useState("");
  const [data_do, setDataDo] = useState("");
  const [nazwa_leku, setNazwaLeku] = useState("");


  const getPrescriptionSearchData = () => {
    Axios.post("http://localhost:8080/api/test3", {
    id_recepty: id_recepty,
    klucz_recepty: klucz_recepty,
    id_pakietu_recept: id_pakietu_recept,
    id_lekarstwa: id_lekarstwa,
    id_użytkownika: id_użytkownika,
    }).then(() => {
      alert("succesful insert");
    });
  };
  return (
    <div className="App">
    <Header>Wyszukiwarka Recept</Header>
    <div className="inputsWrapper">
      <div>
        <label>Pesel:</label>
        <input
          type="text"
          name="pesel"
          onChange={(e) => {
            setPesel(e.target.value);
          }}
        />
      </div>
      <div>
        <label>Data od:</label>
        <input
          type="text"
          name="data_od"
          onChange={(e) => {
            setDataOd(e.target.value);
          }}
        />
      </div>
      <div>
        <label>Data do:</label>
        <input
          type="text"
          name="data_do"
          onChange={(e) => {
            setDataDo(e.target.value);
          }}
        />
      </div>
      <div>
        <label>Nazwa Leku:</label>
        <input
          type="text"
          name="nazwa_leku"
          onChange={(e) => {
            setNazwaLeku(e.target.value);
          }}
        />
      </div>
    </div>

    <button onClick={getPrescriptionSearchData}>getPrescriptionSearchData</button>

  </div>
  );
};
  
export default Search;
